import {Routes, Route, useNavigate} from 'react-router-dom';
import logo from "./img/GCMateIcon.png";
import './App.css';

function App() {
  return (
    <div className="App">
      <div style={{ backgroundImage: `url(${logo})` }}>
      Hello World
      </div>
      <h1>Hello World!</h1>
    </div>
  );
}

export default App;
